   const Card = ({ character, onClose }) => {
      const onCloseClick = () => {
        onClose(id);
      };
   }
   return (
      <div>
         <button onClick={onCloseClick}>X</button>
         <h2> {id} </h2>
         <h2> {name}</h2>
         <h2> {status}</h2>
         <h2> {species}</h2>
         <h2> {gender}</h2>
         <h2> {origin}</h2>
         <img src={image}  alt='' />
      </div>
   );
}
